--------------------------------------------------------
--  DDL for View HV_EVERX
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "RIGEL"."HV_EVERX" ("BOOKED_DATE", "BOOKED_MONTH", "BOOKED_YEAR", "DISB_COUNT", "DEFAULT_DATE", "DEFAULT_DATE_MONTH", "DEFAULT_DATE_YEAR", "MOB", "MOB_MONTH", "MOB_YEAR", "ACCOUNT_ID", "DISB_AMT") AS 
  SELECT
TO_CHAR(ACTT.DISBURSEMENT_DATE,'MON-YYYY') BOOKED_DATE,
TO_CHAR(ACTT.DISBURSEMENT_DATE,'MONTH') BOOKED_MONTH,
TO_CHAR(ACTT.DISBURSEMENT_DATE,'YYYY') BOOKED_YEAR,
ACTT.DISB_COUNT ,
TO_CHAR(MIN(DPD.EFFECTIVE_DT), 'MON-YYYY') DEFAULT_DATE,
TO_CHAR(MIN(DPD.EFFECTIVE_DT), 'MONTH') DEFAULT_DATE_MONTH,
TO_CHAR(MIN(DPD.EFFECTIVE_DT), 'YYYY') DEFAULT_DATE_YEAR,
TO_CHAR(ACTT.MOB_DATE, 'MON-YYYY') MOB ,
TO_CHAR(ACTT.MOB_DATE, 'MONTH') MOB_MONTH ,
TO_CHAR(ACTT.MOB_DATE, 'YYYY') MOB_YEAR ,
ACTT.ACCOUNT_ID,
SUM(ACTT.DISB_AMT) DISB_AMT
FROM 
HI_COLLECTION_DPD dpd, (SELECT
MIN(TO_DATE(TO_CHAR(ACT.TXN_DT, 'MON-YYYY'), 'MON-YYYY')) DISBURSEMENT_DATE ,
ADD_MONTHS(TO_DATE(TO_CHAR(ACT.TXN_DT , 'MON-YYYY'), 'MON-YYYY'),6) MOB_DATE ,
ACT.APPLICATION_NO APPLICATION_NO,
ACT.ACCOUNT_ID ACCOUNT_ID,
count(ACT.APPLICATION_NO) DISB_COUNT,
sum(ACT.BASE_AMOUNT) DISB_AMT
FROM 
HI_ACCOUNT_TXN ACT
WHERE ACT.TXN_TYPE_ID = 101
AND TO_DATE(TO_CHAR(ACT.TXN_DT,'DD-MM-YY'),'DD-MM-YY') BETWEEN  TO_DATE('01-09-12','DD-MM-YY') AND  TO_DATE('28-02-13','DD-MM-YY') 
group by 
ACT.APPLICATION_NO,
ACT.BASE_AMOUNT,
ACT.ACCOUNT_ID,
TO_CHAR(ACT.TXN_DT, 'MON-YYYY')
order by 1 desc ) ACTT
WHERE DPD.CASE_NO =  ACTT.APPLICATION_NO
AND ROUND((DPD.EFFECTIVE_DT - ACTT.DISBURSEMENT_DATE)/30) <=6
group by 
ACTT.ACCOUNT_ID,
ACTT.DISB_COUNT,
ACTT.DISB_AMT,
ACTT.DISBURSEMENT_DATE,
TO_CHAR(ACTT.MOB_DATE, 'MON-YYYY'),
TO_CHAR(ACTT.MOB_DATE, 'MONTH'), 
TO_CHAR(ACTT.MOB_DATE, 'YYYY');
REM INSERTING into RIGEL.HV_EVERX
SET DEFINE OFF;
